/*Table structure for table `referral` */

DROP TABLE IF EXISTS `referral`;

CREATE TABLE `referral` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `referralCode` varchar(50) NOT NULL,
  `referralDate` date NOT NULL,
  `referralTime` varchar(10) NOT NULL,
  `receivingAgencyId` int(11) NOT NULL,
  `acceptingAgencyId` int(11) NOT NULL,
  `accepting_id` int(11) NOT NULL,
  `lab_id` int(11) NOT NULL,
  `customer_id` int(11) NOT NULL,
  `paymentType_id` int(11) NOT NULL,
  `modeofreleaseId` varchar(20) NOT NULL,
  `purposeId` int(11) NOT NULL,
  `discount_id` int(11) DEFAULT '0',
  `sampleArrivalDate` date NOT NULL,
  `samplereceivedDate` date NOT NULL,
  `reportDue` date NOT NULL,
  `conforme` varchar(50) NOT NULL,
  `receivedBy` varchar(50) NOT NULL,
  `gratis` int(11) NOT NULL DEFAULT '0',
  `cancelled` tinyint(1) NOT NULL,
  `state` tinyint(11) NOT NULL DEFAULT '0',
  `validation_status` tinyint(1) NOT NULL,
  `status` int(11) NOT NULL,
  `create_time` datetime NOT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=758 DEFAULT CHARSET=latin1;

