/* Procedure structure for procedure `spGetReferralSeriesAmountByRSTL` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetReferralSeriesAmountByRSTL` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `spGetReferralSeriesAmountByRSTL`(
	mRSTLID INT(11),
	mYear INT(11),
	mQuarter INT(11),
	mLabID INT(11),
	mReferralTypeAmount tinyint(1))
    READS SQL DATA
BEGIN
	-- Stored Prodecure created by Eng'r Nolan F. Sunico
	-- October 27, 2017 12:03 PM
	-- This Procedure generates Series Amount for Income Analytics
	-- by RSTL and Year
	-- mReferralTypeAmount ****************************************
	   -- 1=Total Amount, 
	   -- 2=Gratis Amount, 
	   -- 3=DiscountedAmount
	-- ************************************************************
	DECLARE TotalRow INT(11) DEFAULT 0;
	DECLARE counter INT(11); -- Use in Details Iteration
	DECLARE TotalMonth INT(11);
	declare mTotalAmount decimal(10,2);
	-- Drop Table
	DROP TABLE IF EXISTS `tmp_request`;
	DROP TABLE IF EXISTS `tmp_request2`;
	-- Generate Temporary Table
	CREATE TEMPORARY TABLE `tmp_request` (
	  `TMPRequestID` INT(11) NOT NULL AUTO_INCREMENT,
	  `IntMonth` INT(11),
	  `LabID` INT(11),
	  `Amount` DOUBLE(10,2), -- Overall total
	  `GratisAmount` DOUBLE(10,2), -- Amount need not to pay
	  `DiscountedAmount` DOUBLE(10,2), -- Overall total
	  PRIMARY KEY (`TMPRequestID`)
	)ENGINE=MEMORY;
	CREATE TEMPORARY TABLE `tmp_request2` (
	  `TMPRequestID` INT(11) NOT NULL AUTO_INCREMENT,
	  `IntMonth` INT(11),
	  `LabID` INT(11),
	  `Amount` DOUBLE(10,2), -- Overall total
	  PRIMARY KEY (`TMPRequestID`)
	)ENGINE=MEMORY;
        -- insert record
        IF mLabID=0 THEN -- ALL LABS   (1-(rate/100))
           IF mRSTLID=-1 THEN -- Sum of all RSTL
              INSERT INTO `tmp_request`(`IntMonth`,`Amount`,`GratisAmount`,`DiscountedAmount`,`LabID`) 
	      SELECT MONTH(`referralDate`) ,
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))), 
	      SUM(fee*referral.`gratis`),
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))),
	      `lab_id` AS `LabID` 
	      FROM `referral` 
	      INNER JOIN `sample` ON(`sample`.`referral_id`=`referral`.`id`) 
	      INNER JOIN `analysis` ON(`analysis`.`sample_id`=`sample`.`id`)
	      INNER JOIN `discount` ON(`discount`.`id`=`referral`.`discount_id`)
	      WHERE YEAR(`referralDate`)=mYear and `cancelled`=0 -- AND `gratis`=0 
	      and referral.`acceptingAgencyId` != 0
	      GROUP BY YEAR(`referralDate`), MONTH(`referralDate`);
	   ELSE -- By RSTL
	      INSERT INTO `tmp_request`(`IntMonth`,`Amount`,`GratisAmount`,`DiscountedAmount`,`LabID`)  
	      SELECT MONTH(`referralDate`) ,
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))), 
	      SUM(fee*referral.`gratis`),
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))),
	      `lab_id` AS `LabID` 
	      FROM `referral` 
	      INNER JOIN `sample` ON(`sample`.`referral_id`=`referral`.`id`) 
	      INNER JOIN `analysis` ON(`analysis`.`sample_id`=`sample`.`id`)
	      INNER JOIN `discount` ON(`discount`.`id`=`referral`.`discount_id`)
	      WHERE `acceptingAgencyId`=mRSTLID AND YEAR(`referralDate`)=mYear 
	      and `cancelled`=0 and referral.`acceptingAgencyId` != 0 -- and `gratis`=0 
	      GROUP BY YEAR(`referralDate`), MONTH(`referralDate`);
	   END IF;
	ELSE
	   IF mRSTLID=-1 THEN -- Sum of all RSTL
	      INSERT INTO `tmp_request`(`IntMonth`,`Amount`,`GratisAmount`,`DiscountedAmount`,`LabID`)
	      SELECT MONTH(`referralDate`) ,
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))), 
	      SUM(fee*referral.`gratis`),
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))),
	      `lab_id` AS `LabID` 
	      FROM `referral` 
	      INNER JOIN `sample` ON(`sample`.`referral_id`=`referral`.`id`) 
	      INNER JOIN `analysis` ON(`analysis`.`sample_id`=`sample`.`id`) 
	      INNER JOIN `discount` ON(`discount`.`id`=`referral`.`discount_id`)
	      WHERE `lab_id`=mLabID AND YEAR(`referralDate`)=mYear 
	      and `cancelled`=0 and referral.`acceptingAgencyId` != 0 -- AND SUM(fee)>0 
	      GROUP BY YEAR(`referralDate`), MONTH(`referralDate`);
	   ELSE
	      INSERT INTO `tmp_request`(`IntMonth`,`Amount`,`GratisAmount`,`DiscountedAmount`,`LabID`)
	      SELECT MONTH(`referralDate`) ,
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))), 
	      SUM(fee*referral.`gratis`),
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))),
	      `lab_id` AS `LabID` 
	      FROM `referral` 
	      INNER JOIN `sample` ON(`sample`.`referral_id`=`referral`.`id`) 
	      INNER JOIN `analysis` ON(`analysis`.`sample_id`=`sample`.`id`) 
	      INNER JOIN `discount` ON(`discount`.`id`=`referral`.`discount_id`)
	      WHERE `acceptingAgencyId`=mRSTLID AND YEAR(`referralDate`)=mYear and `lab_id`=mLabID 
	      and `cancelled`=0 and referral.`acceptingAgencyId` != 0 -- and sum(fee)>0
	      GROUP BY YEAR(`referralDate`), MONTH(`referralDate`);
	   END IF;
	END IF;
	if mReferralTypeAmount=1 then -- Total Amount
	      INSERT INTO `tmp_request2`(`IntMonth`,`Amount`,`LabID`)
	      SELECT `MonthID`,IFNULL(`Amount`,0.00),`LabID`
	      FROM `tbl_quarters` 
	      LEFT JOIN `tmp_request` ON (`tmp_request`.`IntMonth`=`tbl_quarters`.`MonthID`)
	      WHERE `Quarter`=mQuarter;
	elseif mReferralTypeAmount=2 THEN -- Gratis Amount
	      INSERT INTO `tmp_request2`(`IntMonth`,`Amount`,`LabID`)
	      SELECT `MonthID`,IFNULL(`GratisAmount`,0.00),`LabID`
	      FROM `tbl_quarters` 
	      LEFT JOIN `tmp_request` ON (`tmp_request`.`IntMonth`=`tbl_quarters`.`MonthID`)
	      WHERE `Quarter`=mQuarter;
	ELSEIF mReferralTypeAmount=3 THEN -- DiscountedAmount
	      INSERT INTO `tmp_request2`(`IntMonth`,`Amount`,`LabID`)
	      SELECT `MonthID`,IFNULL(`DiscountedAmount`,0.00),`LabID`
	      FROM `tbl_quarters` 
	      LEFT JOIN `tmp_request` ON (`tmp_request`.`IntMonth`=`tbl_quarters`.`MonthID`)
	      WHERE `Quarter`=mQuarter;
	end if;
	-- Get the Total
	select SUM(`Amount`) into mTotalAmount 
	FROM `tmp_request2`;
	-- Query 
	SELECT `IntMonth`, SUM(`Amount`) AS Total, mTotalAmount as GrandTotal
	FROM `tmp_request2` GROUP BY `IntMonth`;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spGetReferralSeriesAmountByRSTLYear` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetReferralSeriesAmountByRSTLYear` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `spGetReferralSeriesAmountByRSTLYear`(
	mRSTLID INT(11),
	mStartYear int(11),
	mEndYear int(11),
	mLabID INT(11),
	mReferralTypeAmount TINYINT(1))
    READS SQL DATA
BEGIN
	-- Stored Prodecure created by Eng'r Nolan F. Sunico
	-- October 30, 2017 11:40 PM
	-- This Procedure generates Series Amount for Income Analytics
	-- by RSTL and Year
	DECLARE TotalRow INT(11) DEFAULT 0;
	DECLARE counter INT(11); -- Use in Details Iteration
	DECLARE TotalMonth INT(11);
	DECLARE mTotalAmount DECIMAL(10,2);
	-- Drop Table
	DROP TABLE IF EXISTS `tmp_request`;
	DROP TABLE IF EXISTS `tmp_request2`;
	DROP TABLE IF EXISTS `tmp_years`;
	-- Generate Temporary Table
	CREATE TEMPORARY TABLE `tmp_request` (
	  `TMPRequestID` INT(11) NOT NULL AUTO_INCREMENT,
	  `IntYear` INT(11),
	  `LabID` INT(11),
	  `Amount` DOUBLE(10,2),
	  `GratisAmount` DOUBLE(10,2), -- Amount need not to pay
	  `DiscountedAmount` DOUBLE(10,2), -- Overall total
	  PRIMARY KEY (`TMPRequestID`)
	)ENGINE=MEMORY;
	CREATE TEMPORARY TABLE `tmp_request2` (
	  `TMPRequestID` INT(11) NOT NULL AUTO_INCREMENT,
	  `IntYear` INT(11),
	  `LabID` INT(11),
	  `Amount` DOUBLE(10,2),
	  `GratisAmount` DOUBLE(10,2), -- Amount need not to pay
	  `DiscountedAmount` DOUBLE(10,2), -- Overall total
	  PRIMARY KEY (`TMPRequestID`)
	)ENGINE=MEMORY;
	CREATE TEMPORARY TABLE `tmp_years` (
	  `TMPYearsID` INT(11) NOT NULL AUTO_INCREMENT,
	  `IntYear` INT(11),
	  PRIMARY KEY (`TMPYearsID`)
	)ENGINE=MEMORY;
	-- Insert Years
	set counter=mStartYear;
	myloop: LOOP
	   IF counter>mEndYear then
              LEAVE myloop;
	   END IF;
	   -- Insert to tmp_years
	   insert into tmp_years(IntYear) 
	   values (counter);
	   SET counter=counter+1;
        END LOOP myloop;
        -- insert record
        if mLabID=0 then -- ALL LAB
           IF mRSTLID=-1 THEN -- Sum of all RSTL
              INSERT INTO `tmp_request`(`IntYear`,`Amount`,`GratisAmount`,`DiscountedAmount`,`LabID`) 
	      SELECT year(`referralDate`) ,
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))), 
	      SUM(fee*referral.`gratis`),
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))),
	      `lab_id` AS `LabID` 
	      FROM `referral` 
	      INNER JOIN `sample` ON(`sample`.`referral_id`=`referral`.`id`) 
	      INNER JOIN `analysis` ON(`analysis`.`sample_id`=`sample`.`id`)
	      INNER JOIN `discount` ON(`discount`.`id`=`referral`.`discount_id`)
	      WHERE `cancelled`=0 -- AND `gratis`=0 
	      AND referral.`acceptingAgencyId` != 0
	      and YEAR(`referralDate`) in (SELECT IntYear FROM `tmp_years`) 
	      GROUP BY YEAR(`referralDate`);
	   else
	      INSERT INTO `tmp_request`(`IntYear`,`Amount`,`GratisAmount`,`DiscountedAmount`,`LabID`)  
	      SELECT year(`referralDate`) ,
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))), 
	      SUM(fee*referral.`gratis`),
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))),
	      `lab_id` AS `LabID` 
	      FROM `referral` 
	      INNER JOIN `sample` ON(`sample`.`referral_id`=`referral`.`id`) 
	      INNER JOIN `analysis` ON(`analysis`.`sample_id`=`sample`.`id`)
	      INNER JOIN `discount` ON(`discount`.`id`=`referral`.`discount_id`)
	      WHERE `acceptingAgencyId`=mRSTLID  
	      AND `cancelled`=0 AND referral.`acceptingAgencyId` != 0 -- and `gratis`=0 
	      AND YEAR(`referralDate`) IN (SELECT IntYear FROM `tmp_years`) 
	      GROUP BY YEAR(`referralDate`);
	   end if;
	else -- Specific Lab
	   IF mRSTLID=-1 THEN -- Sum of all RSTL
	      INSERT INTO `tmp_request`(`IntYear`,`Amount`,`GratisAmount`,`DiscountedAmount`,`LabID`)
	      SELECT year(`referralDate`) ,
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))), 
	      SUM(fee*referral.`gratis`),
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))),
	      `lab_id` AS `LabID` 
	      FROM `referral` 
	      INNER JOIN `sample` ON(`sample`.`referral_id`=`referral`.`id`) 
	      INNER JOIN `analysis` ON(`analysis`.`sample_id`=`sample`.`id`) 
	      INNER JOIN `discount` ON(`discount`.`id`=`referral`.`discount_id`)
	      WHERE `lab_id`=mLabID
	      AND `cancelled`=0 AND referral.`acceptingAgencyId` != 0 -- AND SUM(fee)>0 
	      AND YEAR(`referralDate`) IN (SELECT IntYear FROM `tmp_years`) 
	      GROUP BY YEAR(`referralDate`);
	   else -- SPecific RSTL
	      INSERT INTO `tmp_request`(`IntYear`,`Amount`,`GratisAmount`,`DiscountedAmount`,`LabID`)
	      SELECT Year(`referralDate`) ,
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))), 
	      SUM(fee*referral.`gratis`),
	      SUM((fee*(1-(`rate`/100))-fee*(ABS(0-referral.`gratis`)))),
	      `lab_id` AS `LabID` 
	      FROM `referral` 
	      INNER JOIN `sample` ON(`sample`.`referral_id`=`referral`.`id`) 
	      INNER JOIN `analysis` ON(`analysis`.`sample_id`=`sample`.`id`) 
	      INNER JOIN `discount` ON(`discount`.`id`=`referral`.`discount_id`)
	      WHERE `acceptingAgencyId`=mRSTLID AND `lab_id`=mLabID 
	      AND `cancelled`=0 AND referral.`acceptingAgencyId` != 0 -- and sum(fee)>0
	      and YEAR(`referralDate`) IN (SELECT IntYear FROM `tmp_years`) 
	      GROUP BY YEAR(`referralDate`);
	   end if;
	end if;
	IF mReferralTypeAmount=1 THEN -- Total Amount
	      INSERT INTO `tmp_request2`(`IntYear`,`Amount`,`LabID`)
	      SELECT `tmp_years`.`IntYear`,IFNULL(`Amount`,0.00),`tmp_request`.`LabID`
	      FROM `tmp_years` 
	      LEFT JOIN `tmp_request` ON (`tmp_request`.`IntYear`=`tmp_years`.`IntYear`);
	ELSEIF mReferralTypeAmount=2 THEN -- Gratis Amount
	      INSERT INTO `tmp_request2`(`IntYear`,`Amount`,`LabID`)
	      SELECT `tmp_years`.`IntYear`,IFNULL(`GratisAmount`,0.00),`tmp_request`.`LabID`
	      FROM `tmp_years` 
	      LEFT JOIN `tmp_request` ON (`tmp_request`.`IntYear`=`tmp_years`.`IntYear`);
	ELSEIF mReferralTypeAmount=3 THEN -- DiscountedAmount
	      INSERT INTO `tmp_request2`(`IntYear`,`Amount`,`LabID`)
	      SELECT `tmp_years`.`IntYear`,IFNULL(`DiscountedAmount`,0.00),`tmp_request`.`LabID`
	      FROM `tmp_years` 
	      LEFT JOIN `tmp_request` ON (`tmp_request`.`IntYear`=`tmp_years`.`IntYear`);
	END IF;
	-- Get the Total
	SELECT SUM(`Amount`) INTO mTotalAmount 
	FROM `tmp_request2`;
	-- Querty 
	SELECT `IntYear`, SUM(`Amount`) AS Total, mTotalAmount AS GrandTotal
	FROM `tmp_request2` GROUP BY `IntYear`;
    END */$$
DELIMITER ;

